import './Burger.scss';
import { useContext } from 'react';

export default function Burger(props){

    const siteData = useContext(SiteContext);
    const logoSrc = siteData.logo;

    return (
        <div className="Burger" onClick={props.onClick}>
            <img src={logoSrc}/>
        </div>
    );
}
